import React, { useState } from "react";
import AuthForm from "./AuthForm";
import ChatBox from "./ChatBox";  // Chatbot değil, ChatBox!

function App() {
  const [token, setToken] = useState(localStorage.getItem("token"));

  return (
    <div>
      {token ? (
        <ChatBox token={token} />
      ) : (
        <AuthForm setToken={setToken} />
      )}
    </div>
  );
}

export default App;
